import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login'; // Ensure this path is correct

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/login" element={<Login />} />
                {/* Add other routes here */}
            </Routes>
        </Router>
    );
}

export default App;
